@๑ Ⓜ️・⧽﹒Marine 
```La Marine (海軍, Kaigun) est la force militaire principale du Gouvernement Mondial et un des antagonistes de longue durée de la série, à l'instar des 7 Capitaines Corsaires et des Quatre Empereurs, parmi tant d'autres. Elle est présente dans toutes les mers du monde. La Marine est présente dans ces mers sous forme de branches succursales légères. La majeure partie de ses effectifs est stationnée sur la plus dangereuse des mers, la Route de tous les Périls, où leur Quartier Général est situé.

Après l'ellipse, le QG a été déplacé dans le Nouveau Monde, à la base du G-1 [3]. Leur drapeau est une mouette bleue avec l'inscription « Marine » en dessous et de couleur bleue. La Marine représente l'espoir pour la survie des habitants du monde qui ne sont pas des pirates et qui font régulièrement face aux attaques de ces derniers.```

@๑ ☠️・⧽﹒Pirate 
``` Dans le monde de One Piece, les Pirates (海賊, Kaizoku) désignent les personnes ayant hissé un Jolly Roger. Bien qu'ayant des idéologies différentes et des rêves inaccessibles pour la plupart, tous s'accordent sur un même point : l'aventure en mer. Parmi eux, certains se détachent de par leurs exploits ou leur incroyable puissance.

Être un pirate et lever un Jolly Roger ne suffit cependant pas à obtenir une prime, mais par contre, cela suffira pour être arrêté par la Marine. Les bandits des montagnes sont censés être à l'opposé des pirates. Les deux n'ont pas été connus pour avoir de forts liens entre eux.[3]```

